import './style/main.css'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import GuardarLectura from './components/books/GuardarLectura';
import Home from './pages/Home';
import Layout from './layouts/Layout';
import MisLecturas from './components/books/MisLecturas';

function App() {
  return (
    <Router>
      <Routes>
        {/* Envolvemos todas las p√°ginas en el Layout */}
        <Route element={<Layout />}>
          <Route path="/" element={<Home />} />
          <Route path="/guardar-libro" element={<GuardarLectura />} />
            <Route path="/mis-lecturas" element={<MisLecturas />} />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
